package com.yeadun.testutil.product;import com.yeadun.testutil.Config;import com.yeadun.testutil.product.model.P100047;/** * 产品信息 * */public enum ProductType {    NULL("Null", "返回信息为空", Config.PRODUCT_MODEL_PACKAGE + ".NullPOJO"),    P100028("P100028", "自然人风险预警查询", Config.PRODUCT_MODEL_PACKAGE + ".P100028"),    P100029("P100029", "失信执行人风险预警查询接口", Config.PRODUCT_MODEL_PACKAGE + ".P100029"),    P100044("P100044", "黑名单综合查询", Config.PRODUCT_MODEL_PACKAGE + ".P100044"),    P100062("P100062", "短信多重借贷数据", Config.PRODUCT_MODEL_PACKAGE + ".P100062"),    P100007("P100007", "银行卡四要素", Config.PRODUCT_MODEL_PACKAGE + ".P100005"),    P100005("P100005", "银行卡三要素(银行卡卡号，身份证号码，姓名)", Config.PRODUCT_MODEL_PACKAGE + ".P100005"),    P100006("P100006", "银行卡三要素(银行卡卡号，姓名，手机号)", Config.PRODUCT_MODEL_PACKAGE + ".P100005"),    P100047("P100047", "不良记录信息", Config.PRODUCT_MODEL_PACKAGE + ".P100047");    private String prodName;    private String prodCode;    private String POJOClassName;    ProductType(String prodCode, String prodName, String POJOClassName) {        this.prodCode = prodCode;        this.prodName = prodName;        this.POJOClassName = POJOClassName;    }    public String getProdCode() {        return this.prodCode;    }    public String getProdName() {        return this.prodName;    }    public String getPOJOClassName() {        return this.POJOClassName;    }    public String toString() {        return "{\"prodName\": \"" + this.prodName + "\", " +                "\"prodCode\": \"" + this.prodCode + "\", " +                "\"POJOClassName\": \"" + this.getPOJOClassName() + "\"}";    }}